INSERT INTO `data_vars` (`name`, `value`) VALUES
('avito_s', 'Торг;Хороший торг;По цене подвинусь;Разумный торг'),
('av_tire_sizes', '[+ATTR=7+]/[+ATTR=8+]/[+ATTR=9+];[+ATTR=7+]/[+ATTR=8+]R[+ATTR=9+];[+ATTR=7+]x[+ATTR=8+]R[+ATTR=9+];[+ATTR=7+]x[+ATTR=8+]x[+ATTR=9+];\r\nR[+ATTR=9+] [+ATTR=7+]x[+ATTR=8+]'),
('av_tire_title', 'Новое поступление из Японии,Из Японии,Новое поступление,Распродажа'),
('disctextaotomsk', '[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. `("[+TABLE=39+]"=="wheels70")?([+VAR=drom_tx_disc_w70+]):([+VAR=drom_tx_disc_other+])` \r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n\r\nОписание:\r\n[+VAR=disc_params+]\r\n\r\n`("[+ATTR=38+]"=="Томск")?("Возьму Ваши шины и диски на реализацию."):("")`'),
('disctextdrom', '`("[+TABLE=39+]"=="aotomskru")?\r\n([+VAR=disctextaotomsk+]\r\n):(\r\n("[+TABLE=39+]"=="wheels70")?\r\n([+VAR=disctextw70+]\r\n):\r\n([+VAR=disctextother+]\r\n))`'),
('disctextother', '[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. [+VAR=drom_tx_disc_other+]\r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n\r\nОписание:\r\n[+VAR=disc_params+]\r\n\r\n`("[+ATTR=38+]"=="Томск")?("Возьму Ваши шины и диски на реализацию."):("")`'),
('disctextw70', '[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. [+VAR=drom_tx_disc_w70+]\r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n\r\nОписание:\r\n[+VAR=disc_params+]\r\n\r\n`("[+ATTR=38+]"=="Томск")?("Возьму Ваши шины и диски на реализацию."):("")`'),
('disc_params', 'Количество дисков: [+ATTR=28+] шт.`(strlen("[+ATTR=6+]")>1)?("\\nПроизводитель: [+ATTR=6+]"):(" ")` \r\nДиаметр: [+ATTR=9+]\r\nСверловка: [+ATTR=5+]\r\nШирина: [+ATTR=31+]`("[+ATTR=32+]"==0)?(""):("\\nВылет: [+ATTR=32+]")``("[+ATTR=33+]"==0)?(""):("\\nЦО: [+ATTR=33+]")``("[+ATTR=34+]"==0)?(""):("\\nВес: [+ATTR=34+]")``(strlen("[+ATTR=11+]")>1)?("\\nMade in: [+ATTR=11+]"):("")` `(strlen("[+ATTR=35+]")>1)?("\\nОписание: [+ATTR=35+]"):("")`'),
('dlvry_cost', '(([+TABLE=8+]*250*[+ATTR=42+])<[+TABLE=36+])?([+TABLE=36+]):([+TABLE=8+]*250*[+ATTR=42+])'),
('dlvr_0', 'Товар находится в г. [+ATTR=27+]. При покупке по блиц цене упаковка и доставка до склада ТК ПЭК в любом крупном городе включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('dlvr_1', '`([+ATTR=36+]==1||[+ATTR=36+]==2)?("Наличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией. При покупке по блиц цене упаковка и доставка до склада ТК ПЭК в любом крупном городе включена в цену.\r\nОтправка другими тк обсуждается индивидуально. \r\n"):("Самовывоз, г. [+ATTR=27+]\r\nНаличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией.\r\nСтоимость доставки до тк и оформления документов на отправку [+LIST=19+]р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до тк и оформления документов [+LIST=19+]р. за 4 диска.\r\n\r\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \r\n1. Выбираете тк\r\n2. Вводите название тк в гугл\r\n3. Переходите на сайте в раздел \\"калькулятор\\". \r\nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\r\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\r\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.")`'),
('drom_tx_disc_other', '("[+ATTR=38+]"=="[+ATTR=27+]")?(""):((("[+ATTR=38+]"!="[+ATTR=27+]")&&([+LIST=34+]==0))?("\r\nОтправка до склада ТК в город размещения объявления за мой счет. Могу отправить любой транспортной компанией в любой город за ваш счет."):("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет."))'),
('drom_tx_disc_w70', '([+LIST=33+]==1)?("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет. "):("\r\nОтправлю любой транспортной компанией в любой город за ваш счет. ")'),
('dr_disc_title', 'Распродажа! Предлагайте цены! [+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+]'),
('dr_disc_title_std', '[+LIST=14+][+ATTR=3+] [+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+] [+ATTR=31+]J+[+ATTR=32+] [+ATTR=26+]'),
('dr_tire_title', '[+LIST=14+][+ATTR=3+] [+TABLE=6+] [+ATTR=16+] [+ATTR=17+] [+ATTR=7+]/[+ATTR=8+]/[+ATTR=9+] `([+LIST=11+])?("([+ATTR=11+])"):("")` [+ATTR=26+]'),
('guarantyd_0_0', 'Товар б/у, гарантий и возвратов нет. С людьми не понимающими отличие б/у от нового товара - не работаем.\r\nБ/у товар с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров). Если в переписке мы не утверждали проверку дисков на балансире, гарантий на геометрию НЕТ.\r\nНа фото именно эти диски. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в другом месте. Дополнительных фотосессий по вашим капризам не устраиваем. Людей, которые думают, что по доп. фото они смогут определить гнутость дисков или вывести на чистую воду недобросовестного продавца - заслуженно считаем наивными.\r\nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer\r\nОплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра. Покупатель берет на себя риски покупки б/у товара и перевозки дисков транспортной компанией.'),
