(56, 'Текст дром диски вилс70', '[+INTER=62+] \r\n\r\nВСЕ ПРЕДЛОЖЕНИЯ ЦЕНЫ ТОЛЬКО КНОПКОЙ\r\n[+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+], с японского аукциона. \r\nНовогодняя распродажа! В связи с закрытием склада: Предлагайте свои цены (нажимайте кнопку \\"связаться или купить\\" -> \\"предложить цену\\")\r\nНе гнутые, не вареные. Состояние на фото, параметры в описании. Помните что товар б/у.\r\nДиски находятся в г.[+ATTR=27+]. Отправлю в любой город транспортной компанией.\r\nПри покупке от 3 комплектов - доп. скидки, оптовикам - особые условия.\r\n`(strlen("[+ATTR=35+]")>1)?("\r\nОписание: [+ATTR=35+]"):("")`\r\n`("[+ATTR=38+]"=="Томск")?("\r\nВозьму Ваши шины и диски на реализацию."):("")`\r\n`((strlen("[+ATTR=66+]")>0)&&(strlen("[+ATTR=67+]")>0))?("\r\n[+ATTR=66+]V[+ATTR=67+]"):("")`', 2, 'managerActions', 0, 5, 1, 0),
(57, 'Текст дром диски аотомск', '[+INTER=62+] \r\n\r\n[+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+], с японского аукциона. `("[+ATTR=62+]"=="")?(""):("Новогодняя распродажа! В связи с закрытием склада. \r\nПредлагайте свои цены по ссылке: [+ATTR=62+]")`\r\nНе гнутые, не вареные. Состояние на фото, параметры в описании. Помните что товар б/у.\r\nПри покупке по блиц цене - все доставки за мой счет.\r\nПри покупке от 3 комплектов - доп. скидки, оптовикам - особые условия.\r\n`(strlen("[+ATTR=35+]")>1)?("\r\nОписание: [+ATTR=35+]"):("")`\r\nВ объявлении продаются только диски, без шин.\r\n`("[+ATTR=38+]"=="Томск")?("\r\nВозьму Ваши шины и диски на реализацию."):("")`\r\n`((strlen("[+ATTR=66+]")>0)&&(strlen("[+ATTR=67+]")>0))?("\r\n[+ATTR=66+]V[+ATTR=67+]"):("")`\r\n', 2, 'managerActions', 0, 5, 1, 0),
(58, 'Текст дром диски бесплатные', '[+INTER=62+]\r\n\r\n[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. `[+VAR=drom_tx_disc_other+]`\r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n`(strlen("[+ATTR=35+]")>1)?("\\nОписание: [+ATTR=35+]"):("")`\r\n`("[+ATTR=38+]"=="Томск")?("\r\nВозьму Ваши шины и диски на реализацию."):("")`\r\n`((strlen("[+ATTR=66+]")>0)&&(strlen("[+ATTR=67+]")>0))?("\r\n[+ATTR=66+]V[+ATTR=67+]"):("")`', 2, 'managerActions', 0, 5, 1, 0),
(59, 'Заголовок дром диски вилс и ао', '[+LIST=14+][+ATTR=3+] Распродажа! Предлагайте цены! [+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+]', 2, 'managerActions', 0, 5, 1, 0),
(60, 'Заголовок дром диски бесплатные', '[+LIST=14+][+ATTR=3+] [+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+] [+ATTR=31+]J+[+ATTR=32+] [+ATTR=26+]', 2, 'managerActions', 0, 5, 1, 0),
